    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-27T00:45:28.428680",nt"name": "noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-los-angeles-oxnar7e06f",nt"isopen":
    false,nt"url": null,nt"notes": "This digital elevation model (DEM) is a
    part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
    Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
    The DEMs created for this project were developed using the NOAA National Weather
    Service's Weather Forecast Office (WFO) boundaries. Because the WFO boundaries can
    cover large areas, the WFO DEM was divided into smaller DEMs to ensure more manageable
    file sizes. The Los Angeles/Oxnard (CA) WFO DEM was split into two smaller DEMs.
    They are divided along county lines and are: 1. Los Angeles/Oxnard (CA) WFO - Los
    Angeles and Ventura Counties 2. Los Angeles/Oxnard (CA) WFO - Santa Barbara and
    San Luis Obispo Counties This metadata record describes the DEM for Los Angeles/Oxnard
    (CA) WFO - Santa Barbara and San Luis Obispo Counties. The DEM includes the best
    available lidar data known to exist at the time of DEM creation for the coastal
    areas of Santa Barbara and San Luis Obispo counties, that met project specifications.
    The DEM is derived from LiDAR data collected for the California Coastal Conservancy
    between 2009 and 2011. Hydrographic breaklines used in the creation of the DEM were
    obtained from the California Coastal Conservancy. The DEMs are hydro flattened such
    that water elevations are less than or equal to 0 meters. The DEM is referenced
    vertically to the North American Vertical Datum of 1988 (NAVD88) with vertical units
    of meters and horizontally to the North American Datum of 1983 (NAD83). The resolution
    of the DEM is approximately 5 meters.",nt"license_title": null,nt"extras":
